<h1 id="Telco-Churn">Telco Churn<a class="anchor-link" href="#Telco-Churn">&#182;</a></h1><p>This notebook is an example on how to use the Vertica ML Python Library. We will use the Telco Churn dataset to predict which telco user will probably churn. You can download the Jupyter Notebook of the study by clicking <a href="churn.ipynb">here</a>. You can download the dataset of the study on Kaggle by clicking <a href="https://www.kaggle.com/blastchar/telco-customer-churn">here</a>. To achieve our goals, we have access to multiple information.</p>
<ul class="ul_content">
    <li>Customers who left within the last month – the column is called Churn</li>
    <li>Services that each customer has signed up for – phone, multiple lines, internet, online security, online backup, device protection, tech support, and streaming TV and movies</li>
    <li>Customer account information – how long they’ve been a customer, contract, payment method, paperless billing, monthly charges, and total charges</li>
    <li>Demographic info about customers – gender, age range, and if they have partners and dependents</li>
</ul><p>We will follow the entire Data Science cycle (Data Exploration - Data Preparation - Data Modeling - Model Evaluation - Model Deployment) and solve this easy use-case. The purpose is to show you some of the library interesting functionalities.</p>
