    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="o">%</span><span class="k">matplotlib</span> inline
<span class="n">x</span> <span class="o">=</span> <span class="n">churn</span><span class="o">.</span><span class="n">corr</span><span class="p">(</span><span class="n">focus</span> <span class="o">=</span> <span class="s2">&quot;Churn&quot;</span><span class="p">)</span>
</pre></div>

