<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Many features are very correlated to the 'Churn' variable. For example, the customers having a 'Month to Month' contract are more sensible to churn. Indeed, having this type of contract provides a high flexiblity to the customer who can choose to leave the telco company anytime. Besides new customers are more sensible to churn.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[5]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># No lock-in = Churn</span>
<span class="n">x</span> <span class="o">=</span> <span class="n">churn</span><span class="o">.</span><span class="n">hist</span><span class="p">([</span><span class="s2">&quot;Contract_Month-to-month&quot;</span><span class="p">,</span> <span class="s2">&quot;tenure&quot;</span><span class="p">],</span> <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;avg&quot;</span><span class="p">,</span> <span class="n">of</span> <span class="o">=</span> <span class="s2">&quot;Churn&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
