"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can notice in the following Scatter Plot that it is possible to provide better customized tariff plans to avoid churn. Indeed, customers having high total charges are more sensible to churn even if they have a high tenure.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[6]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">x</span> <span class="o">=</span> <span class="n">churn</span><span class="o">.</span><span class="n">scatter</span><span class="p">([</span><span class="s2">&quot;TotalCharges&quot;</span><span class="p">,</span> <span class="s2">&quot;tenure&quot;</span><span class="p">],</span> <span class="n">catcol</span> <span class="o">=</span> <span class="s2">&quot;Churn&quot;</span><span class="p">)</span>
</pre></div>

