<div class="text_cell_render border-box-sizing rendered_html">
<p>We can notice that most of the churning customers have at least one of the following characteristics.</p>
<p><ul>
 <li>Paying more charges</li>
 <li>New to the Telco Company</li>
 <li>Have a Month-to-Month contract</li>
</ul>
We can also notice that Customers having the 'Fiber Optic' option tend more to churn. Let's verify if it is causal by computing some aggregations.</p>

</div>
