<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[10]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Is Fiber optic a Bad Option? - Vertica ML Python</span>

<span class="n">churn</span><span class="o">.</span><span class="n">groupby</span><span class="p">([</span><span class="s2">&quot;InternetService_Fiber_optic&quot;</span><span class="p">],</span> 
              <span class="p">[</span><span class="s2">&quot;AVG(tenure) AS tenure&quot;</span><span class="p">,</span> 
               <span class="s2">&quot;AVG(totalcharges) AS totalcharges&quot;</span><span class="p">,</span>
               <span class="s1">&#39;AVG(&quot;contract_month-to-month&quot;) AS &quot;contract_month-to-month&quot;&#39;</span><span class="p">,</span>
               <span class="s1">&#39;AVG(&quot;monthlycharges&quot;) AS &quot;monthlycharges&quot;&#39;</span><span class="p">])</span>
</pre></div>

</div>
</div>
